﻿#nullable disable
using System;
using System.Collections.Generic;
using System.Linq;

using ADEXS.Core.Domain;
using ADEXS.Web.AtlasUrl;
using ADEXS.Web.Common;
using ADEXS.Web.Controls;
using ADEXS.Web.DotVVM.ViewModels;

using DotVVM.Framework.Binding;
using DotVVM.Framework.Controls;
using DotVVM.Framework.Hosting;

namespace ADEXS.Web.DotVVM.Controls;

/// <summary>
/// Replacement for Telerik RadGrid.
/// </summary>
public class AtlasGridView : GridView, IPostbackEventHandler
{
	// This needs to be in sync with the markup.
	internal const string DummyRowClass = "AtlasGridViewDummyRow";

	// This can be set to a different script that defines emptyRow.
	private string _emptyRowFunction { get; set; }
	internal string EmptyRowFunction
	{
		get => _emptyRowFunction ??=
@"function() {
var emptyRow = document.createElement('tr');
emptyRow.setAttribute('class', '" + (AddAspStyle ? "gridRowEmpty" : "rgNoRecords") + @"');
var cell = document.createElement('td');
cell.setAttribute('style', 'text-align:left;');
emptyRow.appendChild(cell);
var div = document.createElement('div');
div.textContent = '" + Resources.Atlas.NoItems + @"';
cell.appendChild(div);
return emptyRow; }";
		set => _emptyRowFunction = value;
	}

	internal const string HandleEmptyGridTableFunction = "handleEmptyGridTable";

	private const string SortEventType = "sort";

	private const char SessionSortExpressionSeparator = '|';

	// If top or bottom pager id is provided, the pagers will be moved into the table.
	// See comments in method MovePagersToGridTable for details.
	public string TopPagerId
	{
		get { return (string)GetValue(TopPagerIdProperty); }
		set { SetValue(TopPagerIdProperty, value); }
	}
	public static readonly DotvvmProperty TopPagerIdProperty
		= DotvvmProperty.Register<string, AtlasGridView>(c => c.TopPagerId, null);

	public string BottomPagerId
	{
		get { return (string)GetValue(BottomPagerIdProperty); }
		set { SetValue(BottomPagerIdProperty, value); }
	}
	public static readonly DotvvmProperty BottomPagerIdProperty
		= DotvvmProperty.Register<string, AtlasGridView>(c => c.BottomPagerId, null);

	// If set to true, the grid will be integrated with the selection control.
	// See comments in method IntegrateWithSelectionControl for details.
	public bool EnableSelection
	{
		get { return (bool)GetValue(EnableSelectionProperty); }
		set { SetValue(EnableSelectionProperty, value); }
	}
	public static readonly DotvvmProperty EnableSelectionProperty
		= DotvvmProperty.Register<bool, AtlasGridView>(c => c.EnableSelection, true);

	public bool AddAspStyle
	{
		get { return (bool)GetValue(AddAspStyleProperty); }
		set { SetValue(AddAspStyleProperty, value); }
	}
	public static readonly DotvvmProperty AddAspStyleProperty
		= DotvvmProperty.Register<bool, AtlasGridView>(c => c.AddAspStyle, false);

	public bool AddTelerikStyle
	{
		get { return (bool)GetValue(AddTelerikStyleProperty); }
		set { SetValue(AddTelerikStyleProperty, value); }
	}
	public static readonly DotvvmProperty AddTelerikStyleProperty
		= DotvvmProperty.Register<bool, AtlasGridView>(c => c.AddTelerikStyle, true);

	public bool AddColGroup
	{
		get { return (bool)GetValue(AddColGroupProperty); }
		set { SetValue(AddColGroupProperty, value); }
	}
	public static readonly DotvvmProperty AddColGroupProperty
		= DotvvmProperty.Register<bool, AtlasGridView>(c => c.AddColGroup, true);

	public bool HeaderAsTableRow
	{
		get { return (bool)GetValue(HeaderAsTableRowProperty); }
		set { SetValue(HeaderAsTableRowProperty, value); }
	}
	public static readonly DotvvmProperty HeaderAsTableRowProperty
		= DotvvmProperty.Register<bool, AtlasGridView>(c => c.HeaderAsTableRow, false);

	public GridHeaderOverrides GridHeaderOverrides
	{
		get { return (GridHeaderOverrides)GetValue(GridHeaderOverridesProperty); }
		set { SetValue(GridHeaderOverridesProperty, value); }
	}
	public static readonly DotvvmProperty GridHeaderOverridesProperty
		= DotvvmProperty.Register<GridHeaderOverrides, AtlasGridView>(c => c.GridHeaderOverrides);

	public GridPagerSharedViewModel GridPagerSharedViewModel
	{
		get { return (GridPagerSharedViewModel)GetValue(GridPagerSharedViewModelProperty); }
		set { SetValue(GridPagerSharedViewModelProperty, value); }
	}
	public static readonly DotvvmProperty GridPagerSharedViewModelProperty
		= DotvvmProperty.Register<GridPagerSharedViewModel, AtlasGridView>(c => c.GridPagerSharedViewModel);


	#region Page Lifecycle

	protected override void OnInit(IDotvvmRequestContext context)
	{
		if (EmptyDataTemplate == null)
		{
			EmptyDataTemplate = new LiteralTemplate(string.Empty);
		}

		if (AddTelerikStyle)
		{
			// Table attributes from legacy radgrid table.
			this.AddCssStyle("width", "100%")
				.AddCssStyle("table-layout", "fixed")
				.AddCssStyle("empty-cells", "show");
		}

		if (AddAspStyle)
		{
			// Table attributes from legacy asp table.
			this.AddAttribute("cellspacing", "0");
			this.AddAttribute("border", "0");
		}

		if (GridPagerSharedViewModel != null)
		{
			LoadGridSortExpressionFromSession();
		}

		base.OnInit(context);
	}

	protected override void OnLoad(IDotvvmRequestContext context)
	{
		var basePageProvider = context.GetBasePageViewModel();
		if (EnableSelection)
		{
			IntegrateWithSelectionControl(basePageProvider);
		}

		if (AddColGroup)
		{
			CreateGridTableColgroup(basePageProvider);
		}

		HandleEmptyGridTable(basePageProvider);

		if (HeaderAsTableRow)
		{
			MoveHeaderToGridTable(basePageProvider);
		}

		if (TopPagerId != null || BottomPagerId != null)
		{
			MovePagersToGridTable(basePageProvider);
		}

		base.OnLoad(context);
	}

	protected override void OnPreRender(IDotvvmRequestContext context)
	{
		if (GridHeaderOverrides != null)
		{
			if (GridPagerSharedViewModel == null)
			{
				throw new ArgumentException($"{nameof(GridPagerSharedViewModel)} must also be provided along with {nameof(GridHeaderOverrides)}");
			}

			ConfigureHeader(GridHeaderOverrides);
		}

		RemoveInvisibleColumns();

		base.OnPreRender(context);
	}

	#endregion

	internal void RemoveInvisibleColumns()
	{
		for (var i = Columns.Count - 1; i >= 0; i--)
		{
			if (!Columns[i].Visible)
			{
				Columns.RemoveAt(i);
			}
		}
	}

	internal static IEnumerable<TGridItem> GetGridItems<TGridItem, TDataItem>(
		IEnumerable<TDataItem> dataItems,
		Func<TDataItem, int, TGridItem> getGridItemFunc,
		int pageSize) where TGridItem : GridItemViewModel, new()
	{
		var gridItems = new List<TGridItem>();
		var rowIndex = 0;
		foreach (var dataItem in dataItems)
		{
			var gridItem = getGridItemFunc(dataItem, rowIndex);
			gridItem.DetermineAlternateRow(rowIndex, pageSize);
			gridItems.Add(gridItem);
			rowIndex++;
		}

		if (!gridItems.Any())
		{
			// Add dummy row so that dotvvm still renders the table headers.
			var fakeRow = new TGridItem { IsFakeRow = true };
			fakeRow.Attributes.Style = "display:none";
			gridItems.Add(fakeRow);
		}

		return gridItems;
	}

	private void LoadGridSortExpressionFromSession()
	{
		var sessionSortExpression = SessionData.CurrentUser.Settings.Get<string>(SessionSortExpressionKey, null);
		if (!string.IsNullOrEmpty(sessionSortExpression))
		{
			var tokens = sessionSortExpression.Split(SessionSortExpressionSeparator);
			if (tokens.Length > 0)
			{
				GridPagerSharedViewModel.GridSortExpression = tokens[0];
			}

			if (tokens.Length > 1)
			{
				var directionStr = tokens[1];
				GridPagerSharedViewModel.GridSortDirection = "DESC".Equals(tokens[1], StringComparison.OrdinalIgnoreCase)
					? AtlasSortDirection.Descending
					: AtlasSortDirection.Ascending;
			}
		}
	}

	private void ConfigureHeader(GridHeaderOverrides gridHeaderOverrides)
	{
		var columns = Columns.Where(column => !string.IsNullOrEmpty(column.SortExpression))
			.ToDictionary(column => column.SortExpression, StringComparer.OrdinalIgnoreCase);

		foreach (var headerCellOverride in gridHeaderOverrides.HeaderCellOverrides)
		{
			if (!columns.ContainsKey(headerCellOverride.SortExpression))
			{
				// We have configuration for a column that doesn't exist, or sort expressions don't match.
				continue;
			}

			var column = columns[headerCellOverride.SortExpression];

			if (!headerCellOverride.EnableSorting)
			{
				column.HeaderText = headerCellOverride.HeaderText;
			}
			else
			{
				var gridSortingModel = new GridSortingModel()
				{
					GridSortDirection = GridPagerSharedViewModel.GridSortDirection,
					GridSortExpression = GridPagerSharedViewModel.GridSortExpression
				};

				column.HeaderTemplate = new HeaderCellTemplate(
					headerCellOverride,
					gridSortingModel,
					postbackTarget: ID);

				if (!string.IsNullOrEmpty(headerCellOverride.SortedClass)
					&& string.Equals(gridSortingModel.GridSortExpression, headerCellOverride.SortExpression, StringComparison.OrdinalIgnoreCase))
				{
					var sortedClassDecorator = new Decorator()
						.AddAttribute($"class", headerCellOverride.SortedClass);
					column.HeaderCellDecorators.Add(sortedClassDecorator);
				}
			}
		}
	}

	private void SortGrid(string sortExpression)
	{
		if (GridPagerSharedViewModel == null)
		{
			throw new ArgumentException($"{nameof(GridPagerSharedViewModel)} must be passed to grid {ID} in markup for sorting to work.");
		}

		if (string.Equals(sortExpression, GridPagerSharedViewModel.GridSortExpression, StringComparison.OrdinalIgnoreCase))
		{
			GridPagerSharedViewModel.GridSortDirection = GridPagerSharedViewModel.GridSortDirection == AtlasSortDirection.Ascending
				? AtlasSortDirection.Descending
				: AtlasSortDirection.Ascending;
		}

		GridPagerSharedViewModel.GridSortExpression = sortExpression;

		var settingValue = $"{GridPagerSharedViewModel.GridSortExpression}{SessionSortExpressionSeparator}{(GridPagerSharedViewModel.GridSortDirection == AtlasSortDirection.Descending ? "DESC" : "ASC")}";
		SessionData.CurrentUser.Settings.Set(SessionSortExpressionKey, settingValue);
	}

	private string SessionSortExpressionKey => UserSettings.UserSettingConstants.GridSortExpression + GridPagerSharedViewModel?.ConfigurationKey ?? string.Empty;

#pragma warning disable CA1822 // Member 'IntegrateWithSelectionControl' does not access instance data and can be marked as static
	private void IntegrateWithSelectionControl(IBasePageProvider provider)
#pragma warning restore CA1822 // Member 'IntegrateWithSelectionControl' does not access instance data and can be marked as static
	{
		// To integrate with Atlas selection and menu system:
		// - For menu actions to work, SelectionControl needs to be added to the page: <mc:SelectionControl />
		// - Add _selection attribute to rows. This value will be written to SelectionControl value and it will be available in
		// HttpContext.Current.Items["Selection"] which is used in RequestSelection and menu actions.
		// Example: <tr _selection="MetadataGroup,55fe3c2e-1f36-ee11-be09-d8bbc17a33e8;">
		// - Add a checkbox anywhere inside tr element with this specific class and onclick: <input type="checkbox" class="atlasGridViewRowChkSelect" onclick="atlasGridViewRowChkSelectToggle(event)" />
		// - [Optional] Add select/deselect all checkbox anywhere inside the table with this specific onclick: <input type="checkbox" onclick="atlasGridViewChkSelectAllToggle(event)" />
		// - [Optional] Add this specific onclick to tr elements so that clicking on a row deselects all other rows and selects only that row:
		// <tr onclick="atlasGridViewRowDeselectAllSelectCurrent(event)" />
		// ATLAS_IGNORABLE_SELECTION_TAGNAMES represents an array of tag names that should be ignored for selection if they exist within the tr
		var selectionClientScript = @"const ATLAS_GRID_VIEW_ROW_CHK_SELECT_CLASS = 'atlasGridViewRowChkSelect';
			const ATLAS_GRID_VIEW_ROW_SELECTION_ATTR = '_selection';
			const ATLAS_IGNORABLE_SELECTION_TAGNAMES = ['input', 'select', 'button']; 

			var addAtlasGridViewRowSelection = function(row) {
				var selectionControl = document.getElementById(" + SelectionControl.SelectionIdConstName + @");
				if (!selectionControl) {
					return;
				}

				var rowSelectionValue = row.getAttribute(ATLAS_GRID_VIEW_ROW_SELECTION_ATTR);
				if (!rowSelectionValue) {
					return;
				}

				if (selectionControl.value.includes(rowSelectionValue)) {
					return;
				}

				selectionControl.value = selectionControl.value + rowSelectionValue;
			}

			var removeAtlasGridViewRowSelection = function(row) {
				var selectionControl = document.getElementById(" + SelectionControl.SelectionIdConstName + @");
				if (!selectionControl) {
					return;
				}

				selectionControl.value = selectionControl.value.replace(row.getAttribute(ATLAS_GRID_VIEW_ROW_SELECTION_ATTR), '');
			}

			var selectAtlasGridViewRow = function(row) {
				var chkSelect = row.getElementsByClassName(ATLAS_GRID_VIEW_ROW_CHK_SELECT_CLASS)[0];
				if (chkSelect.disabled) {
					return;
				}

				if (chkSelect) {
					chkSelect.checked = true;
				}

				addAtlasGridViewRowSelection(row);
			}

			var deselectAtlasGridViewRow = function(row) {
				var chkSelect = row.getElementsByClassName(ATLAS_GRID_VIEW_ROW_CHK_SELECT_CLASS)[0];
				if (chkSelect.disabled) {
					return;
				}

				if (chkSelect) {
					chkSelect.checked = false;
				}

				removeAtlasGridViewRowSelection(row);
			}

			var atlasGridViewSelectAll = function(table) {
				var allRows = table.getElementsByTagName('tr');
				Array.from(allRows).forEach(row => {
					if (row.hasAttribute(ATLAS_GRID_VIEW_ROW_SELECTION_ATTR)) {
						selectAtlasGridViewRow(row);
					}
				});
			}

			var atlasGridViewDeselectAll = function(table) {
				var allRows = table.getElementsByTagName('tr');
				Array.from(allRows).forEach(row => {
					if (row.hasAttribute(ATLAS_GRID_VIEW_ROW_SELECTION_ATTR)) {
						deselectAtlasGridViewRow(row);
					}
				});
			}

			var atlasGridViewRowChkSelectToggle = function(event) {
				event.gridSelectionHandled = true;
				var chkSelect = event.target;
				if (chkSelect.disabled) {
					return;
				}

				var row = chkSelect.closest('tr');

				// Onclick event is fired after checkbox checked attribute is toggled.
				if (chkSelect.checked) {
					addAtlasGridViewRowSelection(row);
				} else {
					removeAtlasGridViewRowSelection(row);
				}
			}

			var atlasGridViewRowDeselectAllSelectCurrent = function(event) {
				if (event.gridSelectionHandled || ATLAS_IGNORABLE_SELECTION_TAGNAMES.includes(event.target.tagName.toLowerCase())) {
					return;
				}

				event.gridSelectionHandled = true;
				var row = event.target.closest('tr');
				var table = row.closest('table');
				atlasGridViewDeselectAll(table);
				selectAtlasGridViewRow(row);
			}

			var atlasGridViewChkSelectAllToggle = function(event) {
				if (event.gridSelectionHandled) {
					return;
				}

				event.gridSelectionHandled = true;
				var chkSelectAll = event.target;
				var table = chkSelectAll.closest('table');

				// Onclick event is fired after checkbox checked attribute is toggled.
				if (chkSelectAll.checked) {
					atlasGridViewDeselectAll(table);
					atlasGridViewSelectAll(table);
				} else {
					atlasGridViewDeselectAll(table);
				}
			}";

		provider.RegisterClientScriptBlock(nameof(selectionClientScript), HtmlUtil.GetHtmlForJavaScriptSnippet(selectionClientScript));
	}

	private void MovePagersToGridTable(IBasePageProvider provider)
	{
		const string functionName = "movePagersToGridTable";

		var script = @"var createPagerRow = function(pagerRowClass, pager, gridColumnCount) {
	// Grid pager is a table which will be moved into the grid table thead as a tr.
	// Wrap the pager table so that it's tr > td > table

	var pagerRow = document.createElement('tr');
	pagerRow.setAttribute('class', pagerRowClass);
	var pagerContainer = document.createElement('td');
	pagerContainer.setAttribute('colspan', gridColumnCount);
	pagerRow.appendChild(pagerContainer);
	pager.parentNode.removeChild(pager);
	pagerContainer.appendChild(pager);
	return pagerRow;
}

var " + functionName + @" = function(gridViewId, gridColumnCount, topPagerId, bottomPagerId) {
	var gridTable = document.getElementById(gridViewId);
	if (!gridTable) { return; }

	if (gridTable.getElementsByTagName('tfoot').length > 0) {
		// In case tfoot element already exists, we don't need to move the pager there. 
		return;
	}

	var headerContainer = gridTable.getElementsByTagName('thead')[0];
	if (!headerContainer) { return; }

	var gridTableBody = gridTable.getElementsByTagName('tbody')[0];

	// Move top pager into grid table thead element as top tr.
	if (topPagerId) {
		var topPager = document.getElementById(topPagerId);
		if (topPager) {
			var topPagerRow = createPagerRow('rgPager', topPager, gridColumnCount);
			headerContainer.insertBefore(topPagerRow, headerContainer.firstChild);
		}
	}

	// Move bottom pager into grid table as bottom row.
	if (bottomPagerId) {
		var bottomPager = document.getElementById(bottomPagerId);
		if (bottomPager) {
			var bottomPagerRow = createPagerRow('rgPager', bottomPager, gridColumnCount);
			headerContainer.insertBefore(topPagerRow, headerContainer.firstChild);

			// DotVVM table doesn't have tfoot element so create it and append it before tbody which is last child.
			var footerContainer = document.createElement('tfoot');
			gridTable.insertBefore(footerContainer, gridTable.lastChild);

			// Append the bottom pager to tfoot element as child.
			footerContainer.appendChild(bottomPagerRow);
		}
	}
}";

		// This will render the script on top of body and make sure there is only one instance of it rendered.
		provider.RegisterClientScriptBlock(nameof(MovePagersToGridTable), HtmlUtil.GetHtmlForJavaScriptSnippet(script));

		var executeScript = $"{functionName}('{ID}', {Columns.Count(column => column.Visible)}, {TopPagerId.ToJSArgument()}, {BottomPagerId.ToJSArgument()});";
		provider.AddResponseScript(executeScript);
	}

	private void CreateGridTableColgroup(IBasePageProvider provider)
	{
		var functionName = "createGridTableColgroup";

		var script = @"var " + functionName + @" = function(gridViewId, gridColumnCount) {
	var gridTable = document.getElementById(gridViewId);
	if (!gridTable) { return; }

	if (gridTable.getElementsByTagName('colgroup').length > 0) {
		// Table already has colgroup.
		return;
	}

	// Create a new colgroup element
    var colgroup = document.createElement('colgroup');

    // Add the colgroup as the first child of the table
    if (gridTable.firstChild) {
        gridTable.insertBefore(colgroup, gridTable.firstChild);
    } else {
        gridTable.appendChild(colgroup);
    }

	var headerContainer = gridTable.getElementsByTagName('thead')[0];
	if (!headerContainer) { return; }

	var headerRow = headerContainer.getElementsByTagName('tr')[0];
	if (!headerRow) { return; }

	var headerCells = headerRow.children;

	for (var i = 0; i < headerCells.length; i++) {
		var newCol = document.createElement('col');
		colgroup.appendChild(newCol);
		var width = headerCells[i].getAttribute('_width');
		if (width) {
			newCol.setAttribute('width', width);
			headerCells[i].removeAttribute('_width');
		}
	}
}";

		// This will render the script on top of body and make sure there is only one instance of it rendered.
		provider.RegisterClientScriptBlock(nameof(CreateGridTableColgroup), HtmlUtil.GetHtmlForJavaScriptSnippet(script));

		var executeScript = $"{functionName}('{ID}', {Columns.Count(column => column.Visible)});";
		provider.AddResponseScript(executeScript);
	}

	private void MoveHeaderToGridTable(IBasePageProvider provider)
	{
		const string functionName = "moveHeaderToGridTable";

		var script = @"var " + functionName + @" = function(gridViewId) {
	// DotVVM generates header row inside thead element. We need to move it inside tbody as a row.
	var gridTable = document.getElementById(gridViewId);
	if (!gridTable) { return; }

	var headerContainer = gridTable.getElementsByTagName('thead')[0];
	if (!headerContainer) { return; }

	var headerRow = headerContainer.getElementsByTagName('tr')[0];
	if (!headerRow) { return; }

	headerRow.parentNode.removeChild(headerRow);
	var gridTableBody = gridTable.getElementsByTagName('tbody')[0];
	if (gridTableBody.firstChild) {
		// If table body is not empty, insert as top row.
		gridTableBody.insertBefore(headerRow, gridTableBody.firstChild);
	} else {
		// If table body is empty, use append.
		gridTableBody.appendChild(headerRow);
	}

	// Remove empty thead element.
	headerContainer.parentNode.removeChild(headerContainer);
}";

		// This will render the script on top of body and make sure there is only one instance of it rendered.
		provider.RegisterClientScriptBlock(nameof(MoveHeaderToGridTable), HtmlUtil.GetHtmlForJavaScriptSnippet(script));

		var executeScript = $"{functionName}('{ID}')";
		provider.AddResponseScript(executeScript);
	}

	private void HandleEmptyGridTable(IBasePageProvider provider)
	{
		HandleEmptyGridTable(provider, ID, Columns.Count(column => column.Visible).ToString(), EmptyRowFunction);
	}

	internal static string GetChkSelectScript(bool enableMultiselection) => enableMultiselection ? "atlasGridViewRowChkSelectToggle(event);" : (DotVVM.Controls.SelectionControl.GetClearSelectionControlScript() + "this.closest('tr').click();");

	internal static void RegisterEmptyGridTableClientScript(IBasePageProvider provider)
	{
		var script = @"var " + HandleEmptyGridTableFunction + @" = function(gridViewId, gridColumnCount, emptyRowFunction) {
	// If there is no item to display, dotvvm doesn't include table headers, which we want to include.
	// To achieve this, the backend adds a dummy row when there is no data.
	// We need to find this dummy row and delete it.
	// We also want to display a special row when table is empty.

	var gridTable = document.getElementById(gridViewId);
	if (!gridTable) { return; }

	// If dummy row exists, it means the table is actually empty.
	var dummyRow = gridTable.querySelectorAll('." + DummyRowClass + @"')[0];
	if (!dummyRow) { return; }
	dummyRow.parentNode.removeChild(dummyRow);

	// Create emptyRow
	var emptyRow = emptyRowFunction();

	// Add colspan attribute to the first cell if exists.
	var firstCell = emptyRow.cells[0];
	if (firstCell) {
		firstCell.setAttribute('colspan', '' + gridColumnCount);
	}

	var gridTableBody = gridTable.getElementsByTagName('tbody')[0];
	if (gridTableBody.firstChild) {
		// If table body is not empty, insert as top row.
		gridTableBody.insertBefore(emptyRow, gridTableBody.firstChild);
	} else {
		// If table body is empty, use append.
		gridTableBody.appendChild(emptyRow);
	}
}";

		// This will render the script on top of body and make sure there is only one instance of it rendered.
		provider.RegisterClientScriptBlock(nameof(HandleEmptyGridTableFunction), HtmlUtil.GetHtmlForJavaScriptSnippet(script));
	}

	internal static void AddEmptyGridTableScriptToResponse(IBasePageProvider provider, string gridViewId, string columnCountArg, string emptyRowFunction)
	{
		var executeScript = $"{HandleEmptyGridTableFunction}('{gridViewId}', {columnCountArg}, {emptyRowFunction});";
		provider.AddResponseScript(executeScript);
	}

	private static void HandleEmptyGridTable(IBasePageProvider provider, string gridViewId, string columnCountArg, string emptyRowFunction)
	{
		RegisterEmptyGridTableClientScript(provider);
		AddEmptyGridTableScriptToResponse(provider, gridViewId, columnCountArg, emptyRowFunction);
	}

	internal static string GetSortScriptForHref(string postbackTarget, string sortExpression)
	{
		return HtmlUtil.GetJavascriptForHref(BasePageViewModel.GetInvokeAtlasScript(postbackTarget, sortExpression, SortEventType));
	}

