public class HeaderCellTemplate : ITemplate
{
	public HeaderCellTemplate(HeaderCellOverride headerCellOverride, GridSortingModel gridSortingModel, string postbackTarget)
	{
		if (headerCellOverride == null)
		{
			throw new ArgumentNullException(nameof(headerCellOverride));
		}

		if (gridSortingModel == null)
		{
			throw new ArgumentNullException(nameof(gridSortingModel));
		}

		HeaderCellOverride = headerCellOverride;
		GridSortingModel = gridSortingModel;
		PostbackTarget = postbackTarget;
	}

	private HeaderCellOverride HeaderCellOverride { get; }

	private GridSortingModel GridSortingModel { get; }

	private string PostbackTarget { get; }

	public void BuildContent(IDotvvmRequestContext context, DotvvmControl container)
	{
		if (container == null)
		{
			throw new ArgumentNullException(nameof(container));
		}

		var link = new HtmlGenericControl("a");
		container.Children.Add(link);
		link.AddAttribute("href", AtlasGridView.GetSortScriptForHref(PostbackTarget, HeaderCellOverride.SortExpression));
		link.Children.Add(new HtmlLiteral()
		{
			RenderWrapperTag = false,
			Html = HeaderCellOverride.HeaderText
		});

		if (string.Equals(GridSortingModel.GridSortExpression, HeaderCellOverride.SortExpression, StringComparison.OrdinalIgnoreCase))
		{
			var img = new HtmlGenericControl("img");
			img.AddAttribute("src", WebUrl.BlankImage);
			img.AddAttribute("class", GridSortingModel.GridSortDirection == AtlasSortDirection.Ascending
				? "sprite sprite-sort_arrow_up-small"
				: "sprite sprite-sort_arrow_down-small");
			link.Children.Add(img);
		}
	}
}

