	private void PrepareNodeDataSourceView()
	{
		if (NodeDataSourceView != null)
		{
			return;
		}

		if (string.IsNullOrEmpty(NodeGrid2Control.DataSourceID))
		{
			throw new NotSupportedException($"At least one of {nameof(NodeDataSourceView)} or {nameof(NodeGrid2Control.DataSourceID)} must be set.");
		}

		NodeDataSourceView = Context.GetAtlasDataSource<INode>(NodeGrid2Control.DataSourceID).GetView(viewName: string.Empty);
	}

	private void PopulateGrid()
	{
		// If NodeDataSourceView is set before prerender, that will be used to populate the grid.
		// Otherwise, control with DataSourceId or its viewmodel must implement IAtlasDataSourceControlWrapper. (example: NodeDataSourceViewModel)
		// The wrapped AtlasDataSourceControl needs to implement IAtlasDataSource<INode>. (example: NodeDataSource)
		PrepareNodeDataSourceView();

		var selectQueryArgs = new SelectQueryArguments
		{
			DirectionalSortExpression = GridPagerSharedViewModel.GridSortDirectionalExpression,
			StartRowIndex = GridPagerSharedViewModel.StartRowIndex,
			MaximumRows = GridPagerSharedViewModel.GridPageSize
		};

		var nodes = NodeDataSourceView.ExecuteSelectQuery(selectQueryArgs);
		GridPagerSharedViewModel.TooManyItemsToLoad = (((INodeGrid2Provider)this).DataSourceControl as NodeDataSource)?.TooManyItemsToLoad ?? false;
		var gridNodes = new List<GridNode>();
		var index = 0;
		foreach (var node in nodes)
		{
			gridNodes.Add(GetGridNode(node, index++));
		}

		if (!gridNodes.Any())
		{
			// Add dummy row so that dotvvm still renders the table headers.
			gridNodes.Add(new GridNode { IsFakeRow = true });
		}

		NodeGridDataSet = gridNodes;
		GridPagerSharedViewModel.TotalGridRowCount = selectQueryArgs.TotalRowCount;
	}

	private GridNode GetGridNode(INode node, int dataItemIndex)
	{
		var rowIndex = GridPagerSharedViewModel.GetGridRowIndex(dataItemIndex);

		var gridNode = new GridNode
		{
			CheckoutImage = NodeGrid2Control.GetCheckoutImage(node),
			ChkSelectName = $"{GridViewId}_{dataItemIndex}_chkSelect",
			DataItemIndex = dataItemIndex,
			DescriptionEditorKey = $"{DotVVM.Controls.InPlaceEditor.DescriptionEditorType}_{dataItemIndex}",
			DescriptionText = HttpUtility.HtmlEncode(node.Description),
			EditUrl = NodeGrid.RenderEditUrlInternal(node, NodeGrid.ShouldAllowSpringCMEdit(SessionData.CurrentAccountId)),
			ExtendedContextMenus = NodeGrid2Control.ExtendedContextMenus,
			FaxableImage = NodeGrid2Control.GetFaxableImage(node),
			FileSizeHtml = NodeGrid2Control.GetFileSizeHTML(node),
			GridId = GridViewId,
			GridSortExpression = GridSortExpression,
			HiddenColumns = HiddenColumns,
			HistoryUrl = NodeGrid.RenderHistoryUrlInternal(node, Resources.Atlas.History, NodeGrid2Control.DocumentLinkAction, Context.GetBasePageViewModel().HttpContextProvider.Request),
			Identifier = Selection.FormatSelection(node.Type, node.Uid),
			IsAlternateRow = rowIndex % 2 == 1,
			IsDescriptionEditable = true,
			IsFakeRow = node.Uid == Guid.Empty,
			IsFolder = node is Folder,
			IsFolderNavigateAJAXVisible = node is Folder && NodeGrid2Control.FolderLinkAction == Enums.FolderLinkAction.AjaxNavigate,
			IsNameEditable = true,
			IsSelected = RequestSelection<INode>.Instance.Contains(node),
			IsUnselectable = NodeGrid2Control.IsUnselectableNode(node),
			ModifiedByText = HttpUtility.HtmlEncode(node.UpdatedBy),
			ModifiedHref = string.Format("mailto:{0}", HttpUtility.HtmlEncode(node.UpdatedBy)),
			ModifiedText = NodeGridUtilities.GetUpdatedDate(node),
			ModifiedTitle = NodeGridUtilities.GetUpdatedByTooltip(node),
			NavigationTarget = NodeGrid2Control.GetNavigationTarget(node),
			NavigationUrl = NodeGrid2Control.GetNavigationUrl(node),
			NodeGridId = ID,
			NodeImageTag = NodeGrid2Control.GetNodeImageTag(node),
			Name = node.Name,
			NameEditorKey = $"{DotVVM.Controls.InPlaceEditor.NameEditorType}_{dataItemIndex}",
			OnChkSelectClick = AtlasGridView.GetChkSelectScript(NodeGrid2Control.EnableMultiselection),
			OnClickScript = NodeGrid2Control.GetOnClickScript(node),
			ParentFolderName = NodeGrid2Control.GetParentFolderName(node),
			ParentNavigationUrl = NodeGrid2Control.GetParentNavigationUrl(node),
			RowIndex = rowIndex,
			Selection = Selection.FormatSelection(node.Type, node.Uid),
			ShowContextMenu = NodeGrid2Control.ShowContextMenus,
			StatusImages = NodeGridUtilities.GetStatusImages(node),
			Uid = node.Uid,
			NavigateToFolderOnClickScript = BasePageViewModel.GetInvokeAtlasScript(target: ID, argument: node.Uid.ToString(), eventType: NavigateToFolderEventType),
			UseModifiedByLink = !string.IsNullOrEmpty(node.UpdatedBy)
				&& new Regex(Constants.EmailRegexPattern, RegexOptions.None, TimeSpan.FromMilliseconds(Constants.RegexDefaultTimeoutMilliseconds)).IsMatch(node.UpdatedBy)
		};

		if (node is Document document)
		{
			gridNode.Document = document;
			gridNode.Score = document.Score.ToString("##0");

			switch (NodeGrid2Control.DocumentLinkAction)
			{
				case DocumentLinkAction.None:
					gridNode.IsNameLabelVisible = true;
					break;

				default:
					gridNode.IsMainNavigationLinkVisible = true;
					break;
			}

			// PublicBrowseDocument does not have UserAccount if it open with out logged in
			if (AtlasContext.Current.UserAccount != null)
			{
				gridNode.IsInTrash = NodeGrid2Control.GridTrashHelper.IsFolderInTrash(document.FolderUid);
			}

		}
		else if (node is Folder folder)
		{
			gridNode.Folder = folder;
			gridNode.FolderHasDocuments = folder.HasDocuments ? Resources.Atlas.Yes : Resources.Atlas.No;
			gridNode.FolderPath = folder.GetFolderPath();

			switch (NodeGrid2Control.FolderLinkAction)
			{
				case FolderLinkAction.None:
					gridNode.IsNameLabelVisible = true;
					break;

				case FolderLinkAction.AjaxNavigate:
					gridNode.IsFolderNavigateAJAXVisible = true;
					break;

				default:
					gridNode.IsMainNavigationLinkVisible = true;
					break;
			}

			// PublicBrowseDocument does not have UserAccount if it open with out logged in
			if (AtlasContext.Current.UserAccount != null)
			{
				gridNode.IsInTrash = NodeGrid2Control.GridTrashHelper.IsFolderInTrash(folder.ParentFolderUid);
			}
		}

		return gridNode;
	}

	private void UpdateColumnWidth()
	{
		for (var i = 0; i < NodeGridView.Columns.Count; i++)
		{
			var gridViewColumn = NodeGridView.Columns[i];
			var itemKey = gridViewColumn.SortExpression;
			var columnConfig = (NodeGrid2Control.GridConfigColumns != null) ? NodeGrid2Control.GridConfigColumns.GetByItemKey(itemKey) : null;
			var widthConfig = ConfigureGridColumns.AUTO_WIDTH;
			if (columnConfig != null)
			{
				widthConfig = columnConfig.Width;
			}
			else if (!string.IsNullOrEmpty(itemKey) && ConfigureGridColumns.ItemKeyDefaultWidths.ContainsKey(itemKey))
			{
				widthConfig = ConfigureGridColumns.ItemKeyDefaultWidths[itemKey];
			}

			if (!string.Equals(widthConfig, ConfigureGridColumns.FIXED_WIDTH, StringComparison.OrdinalIgnoreCase) && !string.Equals(widthConfig, ConfigureGridColumns.AUTO_WIDTH, StringComparison.OrdinalIgnoreCase))
			{
				SetGridColumnHeaderWidthAttribute(i, widthConfig);
			}
		}
	}

	private void RemoveInvisibleColumns()
	{
		var columns = NodeGridView.Columns;
		for (int i = columns.Count - 1; i >= 0; i--)
		{
