	private void SetGridColumnHeaderWidthAttribute(int columnIndex, string attrValue)
	{
		const string attrKey = "_width";
		var decorators = NodeGridView.Columns[columnIndex].HeaderCellDecorators;
		var done = false;
		foreach (var decorator in decorators)
		{
			if (decorator.Attributes.ContainsKey(attrKey))
			{
				decorator.SetAttribute(attrKey, attrValue);
				done = true;
			}
		}

		if (!done)
		{
			var dec = new Decorator();
			dec.SetAttribute(attrKey, attrValue);
			decorators.Add(dec);
		}
	}

