	void INodeGrid2Provider.ConfigureDataSource()
	{
		NodeGrid2Control.NodeGrid2Provider.GridDataSourceId = NodeGrid2Control.DataSourceID;

		NodeGrid2Control.NodeGrid2Provider.GridAllowPaging = true; // View.CanPage && EnablePager;
		NodeGrid2Control.NodeGrid2Provider.GridAllowSorting = NodeGrid2Control.NodeGrid2Provider.CanSort;
		NodeGrid2Control.NodeGrid2Provider.UseEmptyDataRow = true;

		if (NodeGrid2Control.NodeGrid2Provider.GridAllowPaging)
		{
			// PublicBrowseDocument does not have currentuser if it open with out logged in
			if (NodeGrid2Control.NodeGrid2Provider.IsPublicBrowseDocumentsPage && SessionData.CurrentUser == null)
			{
				PublicBrowseDocSorting();
			}
			else
			{
				ConfigurePaging();
			}
		}

		if (NodeGrid2Control.NodeGrid2Provider.GridAllowSorting)
		{
			// PublicBrowseDocument does not have currentuser if it open with out logged in
			if (NodeGrid2Control.NodeGrid2Provider.IsPublicBrowseDocumentsPage && SessionData.CurrentUser == null)
			{
				PublicBrowseDocSorting();
			}
			else
			{
				ConfigureSorting();
			}
		}
		else
		{
			NodeGrid2Control.NodeGrid2Provider.SortGrid("", AtlasSortDirection.Ascending);
		}
