	private void ConfigurePaging()
	{
		//Load page size
		string key = UserSettings.UserSettingConstants.GridPageSize + NodeGrid2Control.NodeGrid2Provider.ConfigurationKey;
		int pageSize = SessionData.CurrentUser.Settings.Get(key, int.MinValue);
		if (pageSize == int.MinValue)
		{
			string oldKey = UserSettings.UserSettingConstants.GridPageSize + NodeGrid2Control.NodeGrid2Provider.ConfigurationKey + "radGrid"; //HACK!
			pageSize = SessionData.CurrentUser.Settings.Get(oldKey, int.MinValue);
			if (pageSize != int.MinValue)
			{
				SessionData.CurrentUser.Settings.Set<string>(oldKey, null); //Delete old key
				SessionData.CurrentUser.Settings.Set(key, pageSize); //Resave with new key
			}
		}

		NodeGrid2Control.NodeGrid2Provider.PageSizeSetting = (pageSize == int.MinValue) ? GridPager2.DEFAULT_PAGE_SIZE : pageSize;

		if (NodeGrid2Control.NodeGrid2Provider.PageSizeSetting != NodeGrid2Control.NodeGrid2Provider.GridPageSize)
		{
			NodeGrid2Control.NodeGrid2Provider.GridPageSize = NodeGrid2Control.NodeGrid2Provider.PageSizeSetting;
		}
	}

	private void ConfigureSorting()
	{
		string key = UserSettings.UserSettingConstants.GridSortExpression + NodeGrid2Control.NodeGrid2Provider.ConfigurationKey;
		var gridSort = NodeGridUtilities.LoadGridSort(key);

		string sortColumn = gridSort.First;
		AtlasSortDirection sortDirection = (AtlasSortDirection)(int)gridSort.Second;

		if (!NodeGrid2Control.VisibleColumns.Contains(sortColumn))
		{
			sortColumn = GetDefaultSortColumn(out sortDirection);
		}

		if (NodeGrid2Control.NodeGrid2Provider.GridSortExpression != sortColumn || NodeGrid2Control.NodeGrid2Provider.GridSortDirection != sortDirection)
		{
			NodeGrid2Control.NodeGrid2Provider.SortGrid(sortColumn, sortDirection);
		}
	}

	private string GetDefaultSortColumn(out AtlasSortDirection sortDirection)
	{
		if (NodeGrid2Control.VisibleColumns.Contains("UpdatedDate"))
		{
			sortDirection = AtlasSortDirection.Descending;
			return "UpdatedDate";
		}

		sortDirection = AtlasSortDirection.Ascending;
		return "Name";
	}

	private void PublicBrowseDocPaging()
