namespace ADEXS.Web.Common.Responses
{
	public class CustomProtocolResponse : IWebFormResponse, IMvcResponse, IPortalResponse
	{
		public UrlBuilder Url { get; private set; }

		public CustomProtocolResponse(string url) : this(new UrlBuilder(() => url)) { }
		public CustomProtocolResponse(UrlBuilder url)
		{
			Url = url;
		}

		public void Execute()
		{
			string script;
			// Setting window.location to a custom protocol in IE11 takes you to a blank page. According to MSFT this was as desiged at the time (http://bit.ly/1cxiSKt)
			// Found a solution for this here: http://bit.ly/1dl3FjH
			if (UserAgent.Instance.IsIe11)
			{
				script = string.Format("var iframe = document.createElement('IFRAME');iframe.setAttribute('id','protoIframe');iframe.setAttribute('src', '{0}');iframe.style.display = 'none';iframe.style.width   = 1+'px';iframe.style.height  = 1+'px';document.documentElement.appendChild(iframe);", Url);
			}
			else if (UserAgent.Instance.IsChrome || UserAgent.Instance.IsIe8)
			{
				// ATL-27576 Our hacky solution so users can open the edit app in chrome. Hopefully we can remove this soon
				// If any changes here are made, make sure to mimic the same change in Atlas.Action.js where this same check is done
				var url = "/atlas/action/editapp?customproto=" + Url;
				//TODO: remove the hardcoded springcm edit text here
				script = string.Format("window.open('{0}', 'SpringCM Edit', 'height=210, width=400, top=200, left=200');", url);
			}
			else
			{
				script = "window.location='" + Url + "';";
			}

			JsonResponseUtilities.AddAjaxResponseScript(script);
		}

		public ResponseModel CreateMvcResponse()
		{
			return new CustomProtocolModel(Url.ToString());
		}

		public ResponseModel CreatePortalResponse()
		{
			return new CustomProtocolModel(Url.ToString());
		}
	}
}

