	public sealed override Task Init()
	{
		// WebForms execution order: Master, SecurePage, BasePage, Page (aspx).
		// We execute DotVVM in following order to align with WebForms:
		// LayoutViewModel, Master, BasePageViewModel-Enter, SecurePage, BasePage, DotVVM Redirection Check, BasePageViewModel-Continue, DotVVM PageViewModel, Page (aspx).

		BasePage = GetBasePage();
		IsSecurePage = BasePage is SecurePage;
		var httpContext = HttpContextProvider.Context;
		httpContext.SetHandler(BasePage);
		httpContext.Items[HttpContextItemConstants.FormAccessorKey] = new DotVVMRequestFormAccessor(basePageViewModel: this);

#if NETFRAMEWORK
		// In DotVVM, HttpRequest Params collection excludes form data so we use an aggregator instead.
		httpContext.Items[HttpContextItemConstants.ParamsAccessorKey] = new DotVVMRequestParamsAccessor(HttpContextProvider.Request);
#endif

		// Execution order: LayoutViewModel, Master.
		LayoutInit();

		const string eventDispatcherId = "dotVVMCustomEventDispatcher";

		PrepareBodyElement(eventDispatcherId);
		AddInitClientScripts(eventDispatcherId);

		BasePage.OnPreInitHook();

		// Execution order: SecurePage, BasePage.
		BasePage.OnInitHook();

		// Determine if we should redirect back to Legacy pages based on routing flags
		// DotVVM will throw an interupt exception that is intended for us _not_ to catch.
		RedirectOrContinue();

		// This will make all input values available via BasePageProvider.RequestParams["myInputName"]
		GatherInputValuesOnPostback(elementId: null);

		// Execution order: DotVVM PageViewModel, Page (aspx).
		PageInit();

		return base.Init();
	}

