	public sealed override Task PreRender()
	{
		// WebForms execution order: SecurePage, BasePage, Page (aspx), Master.
		// We execute DotVVM in following order to align with WebForms:
		// BasePageViewModel, SecurePage, BasePage, DotVVM PageViewModel, Page (aspx), LayoutViewModel, Master.

		// Put BasePageViewModel prerender logic here if needed.

		// Execution order: SecurePage, BasePage.
		BasePage.OnPreRenderHook();

		// Execution order: DotVVM PageViewModel, Page (aspx).
		PagePreRender();

		// BasePage has prerender logic inside an event handler. The event is not fired in DotVVM so we need to hook into it.
		BasePage.BasePagePreRenderHook();

		// Execution order: LayoutViewModel, Master.
		LayoutPreRender();

		// Scripts that will be executed at the end of the request.
		AddStartupScripts();

		// Render client scripts at the top of body.
		RenderClientScripts();
		return base.PreRender();
	}

	protected void AddStartupScripts()
	{
		RegisterStartupScript(key: "OverrideTelerikAjax", script: @"targetPostBack = function(targetType, targetId, postBackArgument, inAjaxedTelerikControl)
{
	var postBackTarget = getElementByTagNameAndId(targetType, targetId);
	var targetUniqueId = postBackTarget.attributes['name'].value;
	" + InvokeAtlasFunction + @"(targetUniqueId, postBackArgument);
}");

		// Add custom KnockoutBindings in order to evaluate dotvvm value bound attributes
		// https://stackoverflow.com/questions/12636695/updating-placeholder-attribute-using-knockout/12673879#12673879
		RegisterStartupScript(key: "CustomKnockoutBindings", script: @"const customBindProperties = ['hasdefinition', 'onclick', 'title'];
customBindProperties.forEach((prop) =>{
	ko.bindingHandlers[prop] = {
		init: function (element, valueAccessor) {
			var underlyingObservable = valueAccessor();
			ko.applyBindingsToNode(element, { attr: { [prop]: underlyingObservable } } );
		}
	}
});
");

		// WebForms Telerik overrides __doPostBack function when a control is ajaxed. Atlas JS keeps a copy of the original and call it in some places.
		// In DotVVM, we override __doPostBack which is what needs to be called.
		RegisterStartupScript(key: "doPostBackOriginal", script: "Atlas.Common.doPostBackOriginal = __doPostBack;");
	}

	protected void RenderClientScripts()
	{
		// Client script blocks need to be inserted at the top of body in the order they were registered.
		var clientScriptBlocks = new StringBuilder();
		foreach (var script in ClientScriptBlocks)
		{
			clientScriptBlocks.Append(script);
		}

		Context.GetControlByClientId<HtmlLiteral>(ClientScriptBlocksHtmlliteralId).Html = clientScriptBlocks.ToString();
	}

	private void PrepareBodyElement(string eventDispatcherId)
	{
		// Add body section if it doesn't exist.
		var bodyControl = GetOrCreateBodyControl();

		bodyControl.Children.Insert(0, new MarkupControlContainer("mc:EventDispatcher", c => { c.DataContext = EventDispatcherViewModel; c.ID = eventDispatcherId; }));

		// Add placeholder for client script blocks at top of body.
		bodyControl.Children.Insert(0, new HtmlLiteral { ID = ClientScriptBlocksHtmlliteralId, RenderWrapperTag = false });
	}

	private void AddInitClientScripts(string eventDispatcherId)
	{
		// Make sure the names and ids used here are in sync with where they're used in javascript. Do string search in entire code base during rename.
		RegisterClientScriptBlock("UseDotVVM", HtmlUtil.GetHtmlForJavaScriptSnippet(
@"// Set global useDotVVM variable that indicates DotVVM is enabled.
var useDotVVM = true;
var EVENT_DOTVVM_POSTBACK = 'event-dotvvm-postback';
var DOTVVM_CALLBACK_EVENT_TYPE = '" + CallbackEventType + @"';
var DOTVVM_POSTBACK_EVENT_TYPE = '" + PostbackEventType + @"';

getDotVVMEventDispatcher = function() {
	return document.getElementById('" + eventDispatcherId + @"');
}

// Overwrite WebForms __doPostBack with a function that accepts the same parameters and uses dotvvm event dispatcher.
__doPostBack = function(postBackTarget, postBackArgument) {
	var event = new CustomEvent(EVENT_DOTVVM_POSTBACK, {
		bubbles: false,
		detail: { eventType: '" + PostbackEventType + @"', eventTarget: postBackTarget, eventArgument: postBackArgument },
	});

	getDotVVMEventDispatcher().dispatchEvent(event);
};

// Overwrite WebForms WebForm_DoCallback with a function that accepts the same parameters and uses dotvvm event dispatcher.
WebForm_DoCallback = function(target, argument, clientCallback, context, clientErrorCallback, useAsync) {
	var event = new CustomEvent(EVENT_DOTVVM_POSTBACK, {
		bubbles: false,
		detail: { eventType: '" + CallbackEventType + @"', eventTarget: target, eventArgument: argument, callback: clientCallback, context: context, errorCallback: clientErrorCallback },
	});

	getDotVVMEventDispatcher().dispatchEvent(event);
};

// This can be called in JS to trigger a postback via dotvvm event dispatcher.
" + InvokeAtlasFunction + @" = function(target, argument, eventType = '" + CallbackEventType + @"', clientCallback = null, context = null, clientErrorCallback = null) {
	var event = new CustomEvent(EVENT_DOTVVM_POSTBACK, {
		bubbles: false,
		detail: { eventType: eventType, eventTarget: target, eventArgument: argument, callback: clientCallback, context: context, errorCallback: clientErrorCallback },
	});

	getDotVVMEventDispatcher().dispatchEvent(event);
};

// Update an element's knockout viewmodel property by attribute.
" + UpdateClientViewModelPropertyByAttributeFunction + @" = function(elementId, koPropertyPath, attributeName) {
	" + UpdateElementViewModelFunction + @"(elementId, koPropertyPath, (element) => element.getAttribute(attributeName));
}

// Update an element's knockout viewmodel property by value.
" + UpdateClientViewModelPropertyByValueFunction + @" = function(elementId, koPropertyPath) {
	" + UpdateElementViewModelFunction + @"(elementId, koPropertyPath, (element) => element.value);
}

// Update an element's knockout viewmodel property. Need to call this to update the vm after JS updates the element directly (eg. element.setAttribute('val') or element.value = 'val')
// This will invoke getPropertyValue(element) to get the new value for the vm property.
" + UpdateElementViewModelFunction + @" = function(elementId, koPropertyPath, getPropertyValue) {
	var element = document.getElementById(elementId);
	if (!element) { return; }

	var viewModel = ko.dataFor(element);
	var propertyValue = getPropertyValue(element);

	try {
		var func = new Function('viewModel', 'propertyValue', 'return viewModel.' + koPropertyPath + '(propertyValue);');
		func(viewModel, propertyValue);
	} catch (error) {
		// Ignore the error since this is sometimes called multiple times during page lifecycle when koPropertyPath may not resolve.
	}
}

// Replace an element with the given html, and transfer the existing knockout viewmodel to it.
" + ReplaceElementFunction + @" = function(elementId, html) {
	var oldElement = document.getElementById(elementId);
	if (!oldElement) { return; }
	var tempDiv = document.createElement('div');
	tempDiv.innerHTML = html;
	var newElement = tempDiv.firstChild;
	try {
		var viewModel = ko.dataFor(oldElement);
		if (viewModel) {
			ko.applyBindings(viewModel, newElement);
		}
	} catch (error) {
		// There is no viewModel
	}
	oldElement.replaceWith(tempDiv.firstChild);
}

// For all elements that have the given attribute, override their id with the attribute value.
" + OverrideIdFunction + @" = function(attributeName) {
var elements = document.querySelectorAll('[' + attributeName + ']');
elements.forEach(function(element) {
	element.id = element.getAttribute(attributeName);
});
};
		"));

		RegisterClientScriptBlock("knockout.mapping", HtmlUtil.GetHtmlForJavaScriptFile(WebUrl.Scripts.CustomScript("knockout.mapping.js"), defer: true));
	}

	private void RedirectOrContinue()
	{
		var initialUrl = Context.HttpContext.Request.Url;
		var redirectUrl = DotVVMRoutingService.GetRedirectBackToLegacy(initialUrl);
		if (redirectUrl != null)
		{
			var relativeUri = redirectUrl.OriginalString;

			BasePage.LogRedirect(
				initialUrl.AbsolutePath,
				relativeUri,
				description: "Redirect from DotVVM to WebForms");

			Log.InfoNoPII($"Redirecting to legacy page: {relativeUri} from DotVVM page: {initialUrl.AbsolutePath}");

			Context.RedirectToUrl(relativeUri);
			return;
		}
	}

