#if NETFRAMEWORK
	private HttpFileCollectionBase _fileInputs;
	internal HttpFileCollectionBase GetFileInputs()
	{
		if (_fileInputs != null)
		{
			return _fileInputs;
		}

		var files = new Dictionary<string, HttpPostedFileBase>();

		if (!string.IsNullOrEmpty(FileInputsJSON))
		{
			var uploadedFiles = JsonConvert.DeserializeObject<Dictionary<string, Dictionary<string, string>>>(FileInputsJSON);

			foreach (var file in uploadedFiles)
			{
				// Constants content and fileName are used in dotvvm module while gathering file inputs.
				var bytes = Convert.FromBase64String(file.Value["content"]);
				var stream = new MemoryStream(bytes);
				var postedFile = new AtlasHttpPostedFile(stream, file.Value["fileName"], "application/octet-stream");

				files.Add(file.Key, postedFile);
			}
		}

		_fileInputs = new AtlasHttpFileCollection(files);

		return _fileInputs;
	}
#endif

