	public string GetRouteUrl(string routeName, RouteValueDictionary routeValues)
	{
#if NETFRAMEWORK
		var virtualPathData = RouteTable.Routes.GetVirtualPath(HttpContextProvider.Request.RequestContext, routeName, routeValues);
		var url = virtualPathData.VirtualPath;
		return url;
#elif NETCOREAPP
		var httpContext = HttpContextProvider.Context;
		var urlHelperFactory = httpContext.RequestServices.GetService(typeof(IUrlHelperFactory)) as IUrlHelperFactory;
		if (urlHelperFactory == null)
		{
			throw new NotSupportedException($"{nameof(IUrlHelperFactory)} was not configured in dependency injection.");
