	private void RegisterScript(string key, Action registerScriptAction)
	{
		// Don't register script with same key more than once.
		if (ControlRegistryKeys.Contains(key))
		{
			return;
		}

		registerScriptAction.Invoke();
		_ = ControlRegistryKeys.Add(key);
	}

