	public void OnPostbackCommand(string eventId, string eventTarget, object eventArgument, string eventType)
	{
		var eventResult = HandlePostbackEvent(eventTarget, eventArgument, eventType);
		if (eventResult != null)
		{
			PostbackEventResults.Add(new PostbackEventResult
			{
				EventId = eventId,
				EventResult = eventResult
			});
		}
	}

	private string HandlePostbackEvent(string eventTarget, object eventArgument, string eventType)
	{
		if (BeginPostback != null)
		{
			BeginPostback();
		}

		if (BasePage.TryRaiseStatusPostBackEvent(eventArgument?.ToString()))
		{
			// The postback is handled by the status control.
			return null;
		}

		if (string.IsNullOrEmpty(eventTarget) && this is IPostbackEventHandler handler)
		{
			return handler.HandlePostbackEvent(eventType, eventArgument);
		}

		if (string.IsNullOrEmpty(eventTarget))
		{
			return null;
		}

		if (PostbackEventHandlers.ContainsKey(eventTarget))
		{
			return PostbackEventHandlers[eventTarget].HandlePostbackEvent(eventType, eventArgument);
		}

		var control = Context.GetControlByClientId(clientId: eventTarget, throwIfNotFound: false);
		if (control is null)
		{
			return null;
		}

		if (control is IPostbackEventHandler handlerControl)
		{
			return handlerControl.HandlePostbackEvent(eventType, eventArgument);
		}

		if (control.DataContext is IPostbackEventHandler handlerViewModel)
		{
			return handlerViewModel.HandlePostbackEvent(eventType, eventArgument);
		}

		return null;
	}

