	private HttpRequestMessage CreateSiteInfoRequest(string? basePath, int accountId, Dictionary<string, string> cookies)
	{
		basePath = (basePath ?? AlternativeCloudBaseUri).TrimEnd('/');

		var request = new HttpRequestMessage(HttpMethod.Get, $"{basePath}/Admin/SiteInfo?aid={accountId}");

		request.Headers.TryAddWithoutValidation(WebNetOverrideHeaderName, "true");

		request.Headers.Add("Cookie", cookies.Select(kvp => $"{kvp.Key}={kvp.Value}").ToArray());

		return request;
	}

