		string? basePath,
		Account account,
		UserAccount userAccount,
		Dictionary<string, string> cookies,
		HttpClient client)
	{
		using var request = CreateSiteInfoRequest(basePath, account.Id, cookies);

		// Act
		using var response = await client.SendAsync(request);

		// Assert
		await AssertSiteInfoResponseAsync(response);
