	private static async Task AssertSiteInfoResponseAsync(HttpResponseMessage response)
	{
		AssertOkHtmlResponse(response);
		var htmlDoc = await LoadHtmlDocumentAsync(response);
		AssertHtmlElementInnerText(htmlDoc, "//title", "System Domains - Account Preferences - Docusign CLM");
		AssertHtmlElementInnerText(htmlDoc, "//div[@id='siteInfoPanel']/div[@class='panelHeader']", "System Domains");
		AssertHtmlInputValueNotEmpty(htmlDoc, "//input[@id='LoginUrl']");
		AssertHtmlInputValueNotEmpty(htmlDoc, "//input[@id='SftpUrl']");
	}

	private static async Task<HtmlDocument> LoadHtmlDocumentAsync(HttpResponseMessage response)
	{
		var htmlContent = await response.Content.ReadAsStringAsync();
		var htmlDoc = new HtmlDocument();
		htmlDoc.LoadHtml(htmlContent);
		return htmlDoc;
	}

	private static void AssertOkHtmlResponse(HttpResponseMessage response)
	{
		response.StatusCode.ShouldBe(HttpStatusCode.OK);
		response.Content.Headers.ContentType.ShouldNotBeNull();
		response.Content.Headers.ContentType.MediaType.ShouldBe("text/html");
	}

	private static void AssertHtmlElementInnerText(HtmlDocument htmlDoc, string xpath, string expectedText)
	{
		var node = htmlDoc.DocumentNode.SelectSingleNode(xpath);
		node.ShouldNotBeNull($"Expected to find element at: {xpath}");
		node.InnerText.Trim().ShouldBe(expectedText.Trim(), StringCompareShould.IgnoreLineEndings);
	}

	private static void AssertHtmlInputValueNotEmpty(HtmlDocument htmlDoc, string xpath)
	{
		AssertHtmlInputValue(htmlDoc, xpath, value => value.ShouldNotBeNullOrWhiteSpace());
	}

	private static void AssertHtmlInputValue(HtmlDocument htmlDoc, string xpath, Action<string> valueAssertion)
	{
		var node = htmlDoc.DocumentNode.SelectSingleNode(xpath);
		node.ShouldNotBeNull($"Expected to find input at: {xpath}");
		var valueAttr = node.Attributes["value"];
		valueAttr.ShouldNotBeNull($"Expected a 'value' attribute for input at: {xpath}");
		valueAssertion(valueAttr.Value);
	}

	private async Task TestPageVisualAsync(
		string? basePath,
		Account account,
		UserAccount userAccount,
		Dictionary<string, string> cookies,
		HttpClient client)
	{
		const string screenshotFileName = "SiteInfo.png";
		const string screenshotResultFileName = "SiteInfo-Result.png";
		const string traceFileName = "SiteInfo-Trace.har";

		var updatedBasePath = (basePath ?? AlternativeCloudBaseUri).TrimEnd('/');

		var pageUrl = $"{Endpoint.TrimEnd('/')}/{updatedBasePath}/Admin/SiteInfo?aid={account.Id}";

		using var playwright = await Playwright.CreateAsync();

		await using var browser = await playwright.Chromium.LaunchAsync(browserHelper.CreateBrowserTypeLaunchOptions());

		await using var context =
			await browser.NewContextAsync(browserHelper.CreateBrowserNewContextOptions(traceFileName));

		await context.CopySessionCookiesAsync(cookies, pageUrl);

		var page = await context.NewPageAsync();
		logger.LogInformation("New page created. Current size: {@Size}", page.ViewportSize);

		page.AttachLoggers(logger);
		await page.ResizeViewportAsync(logger);

		try
		{
			logger.LogInformation("Navigating to {PageUrl}", pageUrl);
			await page.GotoAsync(
				pageUrl,
				browserHelper.CreatePageGotoOptions());
			logger.LogInformation("Page loaded successfully");

			var selector = "//div[@id='siteInfoPanel']/div[@class='panelHeader']";
			await page.TryWaitForControlElementAsync(logger, selector);

			await CleanupPageForScreenshotAsync(page);

			var screenshotBlob =
				await page.ScreenshotAsync(browserHelper.CreatePageScreenshotOptions(screenshotFileName));

			logger.LogInformation(
				"Screenshot captured to {ScreenshotFileName}, size: {Size} bytes",
				screenshotFileName,
				screenshotBlob.Length);

			await using var baselineScreenshotStream = GetResourceFileStream($"Screenshots.{nameof(SiteInfoControllerTests)}.{screenshotFileName}");
			baselineScreenshotStream.ShouldNotBeNull("Baseline screenshot is not found");

			await browserHelper.RunVisualParityTestAsync(logger, baselineScreenshotStream, screenshotBlob, screenshotResultFileName, screenshotFileName);
		}
		catch (Exception ex)
		{
			logger.LogError(ex, "An error occurred during Playwright execution");
			throw;
		}
		finally
		{
			await context.CloseAsync();
			logger.LogInformation("Context closed, HAR file saved");
			await browser.CloseAsync();
			logger.LogInformation("Browser closed");
		}
	}

	private async Task CleanupPageForScreenshotAsync(IPage page)
	{
		var inputHandles = await page.QuerySelectorAllAsync("//div[@id='siteInfoPanel']//input[@type='text']");
		foreach (var inputHandle in inputHandles)
		{
			var originalValue = await inputHandle.GetAttributeAsync("value");
			if (string.IsNullOrWhiteSpace(originalValue))
			{
				continue;
			}

			try
			{
				var uri = new Uri(originalValue, UriKind.Absolute);
				var builder = new UriBuilder(uri)
				{
					Scheme = "https",
					Host = "example.com",
					Port = -1
				};
				var newValue = builder.Uri.ToString();

				if (uri.AbsolutePath == "/" && newValue.EndsWith('/'))
				{
					newValue = newValue.TrimEnd('/');
				}

				await inputHandle.EvaluateAsync("element => element.removeAttribute('readonly')");
				await inputHandle.FillAsync(newValue);
				await inputHandle.EvaluateAsync("element => element.setAttribute('readonly', 'readonly')");
			}
			catch (UriFormatException ex)
			{
				logger.LogWarning(ex, "Could not parse URI from input value: {OriginalValue}", originalValue);
			}
		}
	}
