namespace ADEXS.SFTPServer
{
	/// <summary>
	/// Responsible for a single SFTP session (processing ElSFTPServer requests, accessing file system)
	/// </summary>
	public partial class SFTPSession
	{
        private Guid ROOT_FOLDER_ID = Guid.Empty;

        private static readonly IDiscreetLogger _log = DiscreetLogger.GetLogger(typeof(SFTPSession));

        private SSHSession _sshSession; // the ssh session that instantiated this subsytem
        private int _id;    // the id of this connection

        private TElSSHSubsystemThread _thread;

        public SFTPSession(SSHSession sshSession, TElSSHTunnelConnection conn)
		{
            Debug.assert(null != sshSession);
            Debug.assert(null != conn);

            _sshSession = sshSession;
            _id = _sshSession.Id;

            conn.OnError +=new TSSHErrorEvent(Tunnel_OnError);

			_thread = new TElSSHSubsystemThread(new TElSFTPSSHSubsystemHandler(conn, true), conn, true);
			TElSFTPSSHSubsystemHandler handler = (TElSFTPSSHSubsystemHandler) _thread.Handler;

			handler.Server.OnClose += new SBUtils.TNotifyEvent(Server_OnClose);
			handler.Server.OnCloseHandle += new TElSFTPServerCloseHandleEvent(Server_OnCloseHandle);
			handler.Server.OnCreateDirectory += new TElSFTPServerCreateDirectoryEvent(Server_OnCreateDirectory);
			handler.Server.OnError += new TSBSftpErrorEvent(Server_OnError);
			handler.Server.OnFindClose += new TElSFTPServerFindCloseEvent(Server_OnFindClose);
			handler.Server.OnFindFirst += new TElSFTPServerFindFirstEvent(Server_OnFindFirst);
			handler.Server.OnFindNext += new TElSFTPServerFindNextEvent(Server_OnFindNext);
			handler.Server.OnOpen += new SBUtils.TNotifyEvent(Server_OnOpen);
			handler.Server.OnOpenFile += new TElSFTPServerOpenFileEvent(Server_OnOpenFile);
			handler.Server.OnReadFile += new TElSFTPServerReadEvent(Server_OnReadFile);
			handler.Server.OnRemove += new TElSFTPServerRemoveEvent(Server_OnRemove);
			handler.Server.OnRenameFile += new TElSFTPServerRenameFileEvent(Server_OnRenameFile);
			handler.Server.OnRequestAbsolutePath += new TElSFTPServerRequestAbsolutePathEvent(Server_OnRequestAbsolutePath);
			handler.Server.OnRequestAttributes += new TElSFTPServerRequestAttributesEvent(Server_OnRequestAttributes);
			handler.Server.OnWriteFile += new TElSFTPServerWriteEvent(Server_OnWriteFile);

            // unhandled events. these are mainly to identify if clients call them
            handler.Server.OnBlock += new TElSFTPServerBlockEvent(Server_OnBlock);
            handler.Server.OnCreateHardLink += new TElSFTPServerCreateHardLinkEvent(Server_OnCreateHardLink);
            handler.Server.OnCreateSymLink += new TElSFTPServerCreateSymLinkEvent(Server_OnCreateSymLink);
            handler.Server.OnExtendedRequest +=new TElSFTPServerExtendedRequestEvent(Server_OnExtendedRequest);
            handler.Server.OnReadSymLink +=new TElSFTPServerReadSymLinkEvent(Server_OnReadSymLink);
            handler.Server.OnRequestAttributes2 +=new TElSFTPServerRequestAttributes2Event(Server_OnRequestAttributes2);
            handler.Server.OnSetAttributes += new TElSFTPServerSetAttributesEvent(Server_OnSetAttributes);
            handler.Server.OnSetAttributes2 +=new TElSFTPServerSetAttributes2Event(Server_OnSetAttributes2);
            handler.Server.OnTextSeek += new TElSFTPServerTextSeekEvent(Server_OnTextSeek);
            handler.Server.OnUnblock +=new TElSFTPServerUnblockEvent(Server_OnUnblock);
            handler.Server.OnVersionChange +=new TElSftpServerVersionChangeEvent(Server_OnVersionChange);

            _sshSession.OnSSHClosed += new SSHSession.SSHClosedHandler(OnSSHClosed);

            // these two seems are handled by the library
            // handler.Server.OnReceive +=new TElSFTPServerReceiveEvent(Server_OnReceive);
            // handler.Server.OnSend +=new TElSFTPServerSendEvent(Server_OnSend);

			handler.Server.Versions = SBSftpCommon.Unit.sbSFTP3 | SBSftpCommon.Unit.sbSFTP4  | SBSftpCommon.Unit.sbSFTP5 | SBSftpCommon.Unit.sbSFTP6;
	        handler.Server.UseUTF8 = true;

            _log.DebugNoPII($"{_id}: SFTP subsystem started.");
			_thread.Resume();
			AtlasContext.Current.UserAccount = _sshSession.UserAccount;
		}

        void Tunnel_OnError(object Sender, int ErrorCode)
        {
            _log.DebugNoPII($"{_id}: Tunnel error {ErrorCode}.");
        }

        ~SFTPSession()
        {
            DisposeAllHandles();
            _log.InfoNoPII($"{_id}: SFTP Session object destructed.");
        }

		/// <summary>
		/// Is fired when the SFTP connection is gracefully closed
		/// </summary>
		/// <param name="Sender">ElSFTPServer object</param>
		private void Server_OnClose(object Sender)
		{
			AtlasContext.Current.UserAccount = null;

