		/// <summary>
		/// Is fired when SFTP session is established
		/// </summary>
		/// <param name="Sender">ElSFTPServer object</param>
		private void Server_OnOpen(object Sender)
		{
            try
            {
				AtlasContext.Current.UserAccount = _sshSession.UserAccount;
				AtlasContext.Current.ClientIpAddress = _sshSession.RemoteIP;

                // what's the reason to have the version number as a bit field?
                int version = -1;
                for(int bitVer = ((TElSFTPServer) Sender).Version; bitVer != 0; bitVer = bitVer >> 1, version++){}
			    _log.InfoNoPII($"{_id}: SFTP connection established. Protocol Version {version}");
	            ((TElSFTPServer) Sender).UseUTF8 = true;
            }
            catch{}
		}

